// @run-at       document-body
// @grant        none
// @downloadURL https://update.greasyfork.org/scripts/455611/Silent%20Thanks%20for%20TorrentBD.user.js
// @updateURL https://update.greasyfork.org/scripts/455611/Silent%20Thanks%20for%20TorrentBD.meta.js
// ==/UserScript==

// Script for Silent Upvotes
const silent = `
function pushThanks(key) {
	$.ajax({
		url: siteUrl + "ajthank.php" + ajaxSuffix,
		type: "POST",
		data: {
			i: key
		},
		dataType: 'json',
		success: ''
	});
}
`;

const trntids = [];

// Adding Script Locally
(function addScript() {
    let body, script;
    body = document.getElementsByTagName("body")[0];
    if (!body) {window.location.reload();}
    script = document.createElement("script");
    script.setAttribute("type", "text/javascript");
    script.innerHTML = silent;
    body.appendChild(script);
})();

// Pushing every 50ms
(function addThanks() {
    for (let x = 0; x < trntids.length; x++) {
        let wait = x * 100;
        setTimeout(function() {
            location.assign("javascript:pushThanks(" + trntids[x] + ")");
            console.log("X: " + x);
        }, wait);
    }
})();